The '''Dorgeshuun''', often referred to as '''[[cave goblin]]s''' or the "lost tribe", are a [[race]] and tribe of subterranean [[goblin]]s that inhabit the tunnel network beneath southern [[Misthalin]]. [[Dorgesh-Kaan]] is their capital city. Their name, in the ancient goblin language, translates to "Goblins of the Strong Spears."<ref>[[Goblin symbol book]]</ref>

The Dorgeshuun feature heavily in the [[Dorgeshuun quest series]], a set of three [[quest]]s that revolve around the tribe and its city. The series delve into the Dorgeshuun's history and society, as well as their interaction with surface world and [[Humans Against Monsters]].

